import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';
import useSessionTimeout from '../hooks/useSessionTimeout';
import DashboardCharts from '../components/DashboardCharts';
import AdminWalletDisplay from '../components/AdminWalletDisplay';
import RegistrationLinkManager from '../components/RegistrationLinkManager';
import { useAdminWallet } from '../context/AdminWalletContext';
import { useRegistrationLink } from '../context/RegistrationLinkContext';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const { logout, user } = useAuth();
  const { deductFunds, formatCurrency } = useAdminWallet();
  const registrationLinkContext = useRegistrationLink();

  // Initialize session timeout (30 minutes)
  useSessionTimeout(30);

  const [activeTab, setActiveTab] = useState('overview');
  const [loading, setLoading] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);
  const [selectedItems, setSelectedItems] = useState([]);
  const [paymentApprovalSubTab, setPaymentApprovalSubTab] = useState('pending');

  // Mock data - in real app, this would come from API
  const [stats, setStats] = useState({
    totalUsers: 1250,
    activeInvestments: 850,
    totalInvested: 2500000,
    pendingPayouts: 45,
    pendingApprovals: 12,
    totalEarnings: 450000
  });

  const [users, setUsers] = useState([]);
  const [error, setError] = useState('');

  // Fetch users from API
  const fetchUsers = async () => {
    try {
      setLoading(true);
      setError('');
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5000/api/v1/dashboard/users', {
        headers: {
          Authorization: `Bearer ${token}`
        }
      });

      if (response.data.success) {
        setUsers(response.data.data);
      }
    } catch (error) {
      console.error('Error fetching users:', error);
      setError('Failed to fetch users');
    } finally {
      setLoading(false);
    }
  };

  // Load users on component mount
  useEffect(() => {
    fetchUsers();
  }, []);

  const [investments, setInvestments] = useState([
    {
      id: 1,
      user: 'John Doe',
      amount: 50000,
      startDate: '2024-01-15',
      maturityDate: '2024-07-15',
      cycleProgress: 65,
      totalReturns: 12500
    },
    {
      id: 2,
      user: 'Jane Smith',
      amount: 25000,
      startDate: '2024-02-01',
      maturityDate: '2024-08-01',
      cycleProgress: 45,
      totalReturns: 6250
    },
    {
      id: 3,
      user: 'Mike Johnson',
      amount: 75000,
      startDate: '2024-01-10',
      maturityDate: '2024-07-10',
      cycleProgress: 70,
      totalReturns: 18750
    }
  ]);

  const [transactions, setTransactions] = useState([
    {
      id: 1,
      user: 'John Doe',
      walletSource: 'Passive',
      amount: 2500,
      date: '2024-01-20',
      status: 'Completed'
    },
    {
      id: 2,
      user: 'Jane Smith',
      walletSource: 'Bonus',
      amount: 1250,
      date: '2024-01-19',
      status: 'Pending'
    },
    {
      id: 3,
      user: 'Mike Johnson',
      walletSource: 'Passive',
      amount: 3750,
      date: '2024-01-18',
      status: 'Completed'
    }
  ]);

  const [payoutRequests, setPayoutRequests] = useState([
    {
      id: 1,
      user: 'John Doe',
      sourceWallet: 'Passive Wallet',
      amount: 5000,
      method: 'GCash',
      date: '2024-01-20',
      status: 'Pending'
    },
    {
      id: 2,
      user: 'Jane Smith',
      sourceWallet: 'Bonus Wallet',
      amount: 2500,
      method: 'Maya',
      date: '2024-01-19',
      status: 'Pending'
    },
    {
      id: 3,
      user: 'Mike Johnson',
      sourceWallet: 'Passive Wallet',
      amount: 7500,
      method: 'GoTyme',
      date: '2024-01-18',
      status: 'Paid'
    }
  ]);

  const [paymentApprovals, setPaymentApprovals] = useState([]);



  // Fetch payment deposits on component mount
  useEffect(() => {
    fetchPaymentDeposits();
  }, []);

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-PH');
  };

  const handleSearch = (data, searchFields) => {
    if (!searchTerm) return data;
    return data.filter(item =>
      searchFields.some(field =>
        item[field]?.toString().toLowerCase().includes(searchTerm.toLowerCase())
      )
    );
  };

  const handlePagination = (data) => {
    const startIndex = (currentPage - 1) * itemsPerPage;
    return data.slice(startIndex, startIndex + itemsPerPage);
  };

  const handleSelectAll = (data) => {
    if (selectedItems.length === data.length) {
      setSelectedItems([]);
    } else {
      setSelectedItems(data.map(item => item.id));
    }
  };

  const handleSelectItem = (id) => {
    setSelectedItems(prev =>
      prev.includes(id)
