    try {
      const token = localStorage.getItem('token');
      const approval = paymentApprovals.find(p => p.id === approvalId);

      if (action === 'approve') {
        // Check admin wallet balance first
        const success = deductFunds(
          approval.amount,
          approval.userId,
          approval.user,
          `Payment approval for ${approval.user}`
        );

        if (!success) {
          alert('Failed to approve payment: Insufficient funds in Admin Master Wallet');
          return;
        }

        // Call API to approve deposit
        await axios.put(`http://localhost:5000/api/v1/payments/deposits/${approvalId}/approve`, {}, {
          headers: { 'Authorization': `Bearer ${token}` }
        });

        alert(`â‚±${approval.amount.toLocaleString()} credited to ${approval.user}'s wallet`);
      } else {
        // Call API to reject deposit
        const reason = prompt('Enter rejection reason (optional):');
        await axios.put(`http://localhost:5000/api/v1/payments/deposits/${approvalId}/reject`, 
